import React, { useEffect } from 'react';
import './Test.css';
import axios from 'axios';

function Test() {

    const [questions, setQuestions] = React.useState([]);

    useEffect(() => {
        axios.get("https://localhost:7055/Test/GetAllQuestions")
            .then((response) => {
                setQuestions(response.data.questions);
             })
             .catch((err) => {
                console.log(err);
             }); 
      }, [])



    return (
        <div className='test__wrapper'>
            <ul>
                <li>{Object.values(questions)[0]?.question}</li>
                <li>{Object.values(questions)[1]?.question}</li>
                <li>{Object.values(questions)[2]?.question}</li>
                <li>{Object.values(questions)[3]?.question}</li>
                <li>{Object.values(questions)[4]?.question}</li>
                <li>{Object.values(questions)[5]?.question}</li>
                <li>{Object.values(questions)[6]?.question}</li>
                <li>{Object.values(questions)[7]?.question}</li>
                <li>{Object.values(questions)[8]?.question}</li>
                <li>{Object.values(questions)[9]?.question}</li>
                <li>{Object.values(questions)[10]?.question}</li>
            </ul>
        </div>
      );
    };
    
export default Test;
